import React, {Component} from "react"

class Filmovi extends Component{
    constructor(){
        super()
        this.state = {
            filmovi: []
        }
    }
    
    componentDidMount(){
        fetch("http://localhost:8080/bioskop/filmovi")
        .then(response => response.json())
        .then(response => {
            const {data} = response.data
            console.log(data)
            this.setState({
                filmovi: data
            })
        })
    }

    render(){
        const prikaz=(this.state.filmovi.length === 0) ? <h1>Nema jos ni jednog filma</h1>:<h1>Ima filmova</h1>
        return(
            prikaz
        )
    }

}

